                'description' => '{"en":"To manage podcast events within a specific category, navigate to the \'Podcasts\' section in the administrative dashboard. To add a new podcast event to a category, click on the \'Add Podcast Event\' button and select the desired category from the dropdown menu. Fill in the relevant details such as podcast title, episode number, release date, and any additional information. Ensure that the podcast content is aligned with the chosen category to maintain organization and coherence.122\\r\\n\\r\\nIf you need to edit an existing podcast event, locate the event within the chosen category and click on the \'Edit\' option. This will allow you to make necessary adjustments, such as updating episode details or changing the release date. Once you\'ve made the desired changes, click \'Save\' to update the podcast event information within the selected category.\\r\\n\\r\\nShould the need arise to remove a podcast event from a category, locate the event in the category\'s list and select the \'Delete\' option. Confirm the action when prompted, and the podcast event will be permanently removed from the category while remaining in the system overall.\\r\\n\\r\\nTo view a list of all podcast events within a specific category, return to the \'Podcasts\' section and select the desired category from the dropdown menu. Here, you\'ll find a comprehensive list of podcast events within that category, along with their respective details. You can sort and filter the events based on criteria such as release date, episode number, or topic, making it easy to find specific podcast content or get an overview of episodes within the chosen category.\\r\\n\\r\\nBy utilizing these functions, you can efficiently manage your podcast events within specific categories, ensuring they are accurately categorized, organized, and easily accessible to your audience","hi":"To manage podcast events within a specific category, navigate to the \'Podcasts\' section in the a